const MyList = () => {
  return (
    <div>
      <h1 className="heading">My List</h1>

      <div className="movie-container">
        <p className="movie-title">John Wick: Chapter 4</p>
        <p className="movie-desc">
          Action, Thriller, Crime | 2023 | 170 Minutes | R
        </p>
        <p></p>
      </div>
      <div className="movie-container">
        <p className="movie-title">The Super Mario Bros. Movie</p>
        <p className="movie-desc">
          Animation, Adventure, Comedy | 2023 | 92 Minutes | PG
        </p>
        <p></p>
      </div>
    </div>
  );
};

export default MyList;
